import React from 'react';
import { useNavigate } from 'react-router-dom';

function Home() {
	const navigate = useNavigate();
	const handleLogin = () => {
		navigate('/');
	};

	if (localStorage.getItem('email')) {
		return <div>{localStorage.getItem('email')}</div>;
	} else {
		return { handleLogin };
	}
}

export default Home;
